column13:
The deflector (38) comprises: 
- a support (70); 
- an intermediate member (72), pivotally mounted in the support (70) around a first rotation axis (B-B'); 
- at least a secondary pivoting member (74), pivotally connected to the intermediate member (72) around a second rotation axis (C-C') parallel to the first rotation axis (B-B'); 
- for each secondary pivoting member (74), at least a pair of rotating members (76). Each rotating member (76) is connected to the secondary pivoting member (74). The deflector (38) comprises: 
- a guiding mechanism, for guiding each rotating member (76) in translation with regard to the support (70) along a translation axis (D-D') non parallel to the first rotation axis (B-B'); 
- a connecting member (78), pivotally mounted to the secondary pivoting member (74). The rotating member (76) is rotatably mounted on the connecting member (78) around a rotating member rotation axis (E-E').
